.mask {
  position: fixed;
  width: 100%;
  height: 100%;
  top: 0;
  background: #080808;
  opacity:0.7;
  z-index: 9998;
}
.d1 {
  text-align: center;
  position: absolute;
  top: 40%;
  left: 50%;
  -webkit-transform: translate(-50%, -50%);
  transform: translate(-50%, -50%);
  z-index: 99999;
  width: 80%;
  height: 110px;
  color: #3f4b50;
  background: #ffffff;
  padding: 55px;
  border-radius: 15px;
}
.d2 {
  text-align: center;
  position: absolute;
  top: 20%;
  left: 50%;
  font-size: 0.3rem;
  color: #3f4b50;
  -webkit-transform: translate(-50%, -50%);
  transform: translate(-50%, -50%);
  z-index: 99999;
}
progress {
  height: 8px;
  border-radius: 0.25rem;
  width: 100%;
}
progress::-webkit-progress-bar {
  background-color: #f2f2f2;
  border-radius: 0.25rem;
}
progress::-webkit-progress-value {
  height: 8px;
  border-radius: 0.25rem;
  background: linear-gradient(to right, #632891, #00ffcb);
}
